      var selected_tab = // find previously active tab
      tab_container.find('.tm-a,.tm-a-2') // remove previously active tab
      .removeClass('a-active').end() // unwrap previously active tab
      .find('.menu-wrap-a .tm-a').unwrap().unwrap() // go back to selected target
      .end().end() // set active class to it
